import ArgonHeaderLogin from '../component/layouts/ArgonHeaderLogin';
import ArgonBodyLogin from '../component/layouts/ArgonBodyLogin';

class Login extends React.Component{

    render(){
        return(
            <Html>
                <ArgonHeaderLogin title= "Login Account"/>
                <ArgonBodyLogin bgClassName="bg-default">
                    <p>ok</p>
                </ArgonBodyLogin>
            </Html>
        )
    }
}

export default Login;
